-- Table structure for `user_events`
-- ----------------------------
DROP TABLE IF EXISTS `user_events`;
CREATE TABLE `user_events` (
  `iduser_events` int(11) NOT NULL AUTO_INCREMENT,
  `attended_at` varchar(45) NOT NULL,
  `event_idevent` int(11) NOT NULL,
  `user_iduser` int(11) NOT NULL,
  PRIMARY KEY (`iduser_events`,`event_idevent`),
  KEY `fk_user_events_user1_idx` (`user_iduser`),
  KEY `fk_user_events_event1_idx` (`event_idevent`),
  CONSTRAINT `fk_user_events_event1` FOREIGN KEY (`event_idevent`) REFERENCES `event` (`idevent`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_user_events_user1` FOREIGN KEY (`user_iduser`) REFERENCES `user` (`iduser`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

